                6 => 
                array (
                    'id' => 7,
                    'title' => 'Software for MacOS Developers',
                    'slug' => 'software-for-macos-developers',
                    'thumbnail' => '01J75WPVGDD849TREM9KGPBNNM.webp',
                    'body' => '<p>Here’s a summary of essential software for macOS development. All of these tools are free, and most are open-source. I hope they enhance your development experience.</p><h1>Basics</h1><h2>Git</h2><p>Git needs no introduction. Simply run git in the terminal, and a dialog will pop up. Click install. This typically installs the basic Xcode runtime environment as well. Alternatively, you can install it by running xcode-select --install in the terminal.</p><h2><a href="https://www.servbay.com/"><span style="text-decoration: underline;">ServBay</span></a></h2><p>ServBay is probably the best development environment for Mac. It allows easy one-click installation of various development environments and simplifies subsequent upgrades. For teams, it ensures consistency in dependencies and configurations.</p><h1>Terminal Tools</h1><h2><a href="https://iterm2.com/"><span style="text-decoration: underline;">iTerm2</span></a> + <a href="https://ohmyz.sh/#install"><span style="text-decoration: underline;">Oh-My-Zsh</span></a></h2><p>iTerm2 is the premier terminal on Mac, and Oh-My-Zsh provides powerful theming and plugin capabilities.</p>',
                    'active' => 1,
                    'published_at' => '2021-10-19 01:22:46',
                    'user_id' => 3,
                    'created_at' => '2024-09-07 09:23:12',
                    'updated_at' => '2024-09-07 09:42:28',
                    'meta_title' => NULL,
                    'meta_description' => NULL,
                ),
                7 => 
                array (
                    'id' => 8,
                    'title' => 'Why TDD is a waste of time',
                    'slug' => 'why-tdd-is-a-waste-of-time',
                    'thumbnail' => '01J75WZCHYB8R6SAM5YX5HY6KV.webp',
                    'body' => '<p>As an ex-practitioner of TDD, it is time to give the credit it deserves, TDD is not worth it. As a developer, I need to spend as much time as possible writing code, I can’t be spending valuable time writing tests.</p><p>A few days ago, I was writing an endpoint to manage an online banking bank account. This required the account to exist in the database, a valid login/password, and data from an external microservice. There are too many things to set up mocks.</p><p>Writing automated tests is just a waste of time. When you are working on a critical feature, you can simply:</p><ul><li>Develop</li><li>Test/Debug locally</li><li>Set data in the local database</li><li>Disabling the endpoint authentication so you don’t have to set data on the authentication system</li><li>Put a breakpoint on the external API call to replace the data returned.</li><li>Or, in case of time-sensitive features, like late appointments or payment reminders, you can wait for the reminders to kick in.</li></ul><p>After each change, we can repeat the process above for our feature and all other possible scenarios we might have impacted. 20 scenarios to test? No problem.</p>',
                    'active' => 1,
                    'published_at' => '2023-06-06 01:27:45',
                    'user_id' => 3,
                    'created_at' => '2024-09-07 09:27:52',
                    'updated_at' => '2024-09-08 03:04:40',
                    'meta_title' => NULL,
                    'meta_description' => NULL,
                ),
                8 => 
                array (
