                    'thumbnail' => '01J75XEKBS0SS5BPX8P6P5QZAT.webp',
                    'body' => '<p>React is a JavaScript library for building user interfaces, which allows developers to create web and native applications using a component-based architecture. It\'s known for its efficiency and flexibility, enabling developers to build complex UIs from encapsulated components that manage their own state.</p>',
                    'active' => 1,
