                10 => 
                array (
                    'id' => 11,
                    'title' => 'Behind the Scenes',
                    'slug' => 'behind-the-scenes',
                    'thumbnail' => '01J75XKV58R52DGFSXRYG0WKFQ.webp',
                    'body' => '<h2>An inside look at my experience as a Kubernetes Release Team shadow, contributing to versions v1.29, v1.30, and v1.31.</h2><p>Kubernetes has become the de facto standard for container orchestration in the cloud-native ecosystem, powering some of the most critical infrastructures worldwide. Originally designed by Google, a worldwide community of contributors now maintains the project, and the Cloud Native Computing Foundation holds the trademark.</p><p>The Kubernetes release process, which ensures the platform\'s stability and improvement, is central to its continued success and evolution. A dedicated and diverse team of contributors from various global organizations manages this process.</p><p>I had the incredible opportunity to serve as a shadow on the Kubernetes Release Team, contributing to the release of Kubernetes versions v1.29,v1.30, and v1.31. In this article, I’ll take you behind the scenes of my journey, sharing the challenges I encountered, the critical lessons learned, and how being part of the vibrant Kubernetes community has shaped my growth as a developer.</p><h1><br></h1><p><br><br></p>',
                    'active' => 1,
